import Register from "./components/pages/auth/register";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <h1>Hello React</h1>
      {/* <Register/> */}

      <Routes>
        <Route path="/register" element={<Register/>}/>
      </Routes>
    </div>
  );
}

export default App;
